                <SectionTitle title="Where Iâ€™ve Worked" number="02" />
                <div className="work-wrapper mt-20">
                    <div className="work-nav">
                        <ul className={classes.lists}>
                            <li className={classes.list}>Cubix IT Limited</li>
                            <li className={classes.list}>Spire Sparkle Agency</li>
                            <li className={classes.list}>Fiverr, Upwork</li>
                        </ul>
                    </div>
